import React from 'react';

import data from './data'

class App extends React.Component {

  state = {
    questions: data
  }

  render() {
    console.log(this.state.questions)
    return (
      <div>
        <Header />
        <QuestionCard questions={this.state.questions}/>
        <ScoreForm />
      </div>
    );
  }

}

export default App;
